            fontSize: 10,
          }}
        >
          Sep
        </b>
      </div>
      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div 
        style={{
          backgroundColor: "#3d21a7",
