            fontSize: 10,
          }}
        >
          Oct
        </b>
      </div>
      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('01') ? "`100`%" : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "1px solid black",
          position: "absolute",
         
        }}
        ></div>
        <b
          style={{
            position: "absolute",
